(66, 'Clorox Clean-Up All Purpose Spray Cleaner with Bleach, Original', 'Clorox Clean-Up all purpose bleach spray cleaner is designed to quickly and effectively clean, disinfect and deodorize a variety of surfaces both indoors and outdoors. Proven to kill the COVID-19 virus, this disinfecting spray also kills 99.9% of bacteria and viruses. With the power to remove tough kitchen and bath stains, grease and dirt on contact, this household cleaner can be used on multiple hard, nonporous surfaces throughout your home, including kitchen sinks, counters, refrigerators, appliances, tubs, toilets, fiberglass, floors, showers and tiles. With the Smart Tube technology bottle, you are guaranteed to spray every last drop. The easy to use trigger lets you spray into corners and hard to reach places for a thorough clean. This disinfecting spray leaves your home sparkling clean and smelling fresh. The Clorox Clean Up Cleaner with Bleach gets the job done. Kills SARS-CoV-2 on hard, nonporous surfaces. Use as directed for other germs. (from Clorox)', 7, 6.59, NULL, 'ea', 1.00, '/uploads/products/66.jpg', NULL, NULL),
(67, 'Seventh Generation Natural Dish Liquid, Free and Clear', 'Seventh Generation free and clear dish liquid is made of powerful plant-based ingredients that clean the dirtiest dishes while being gentle on skin. Clinically proven to be hypoallergenic, our dish liquid is free from fragrances, dyes, and triclosan. Our products are never tested on animals and our dish liquid is biodegradable. Tough on grease, gentle on hands, safe for septic and greywater systems. Dried-on food and grease don\'t stand a chance against the plant-based power of our dishwashing liquid. (from Seventh Generation)', 7, 9.19, NULL, 'ea', 1.00, '/uploads/products/67.jpg', NULL, NULL),
